import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
import { Observable, ObservableNotification } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class ContentfulService {

  private readonly URL = 'https://cdn.contentful.com/spaces/8utyj17y1gom/entries?access_token=e50d8ac79fd7a3545d8c0049c6a1216f5d358a192467c77584eca6fad21e0f37&content_type=pageTemplate&include=1&fields.url=%2Fhome%2Fsupport'


  constructor(private http: HttpClient) { }

  retrieveContent(): Observable<any> {
    console.log("Request is sent");
    return this.http.get(this.URL);
  }
}
